Table_Top_10_Partners_AOV.query:
q = load &quot;APM_ISV&quot;;
q_A = filter q by  {{cell(Fiscal_Year_1.selection,0,&quot;PY&quot;).asEquality(&#39;Fiscal_Year&#39;)}};
q_B = filter q by  {{cell(Fiscal_Year_1.selection,0,&quot;CY&quot;).asEquality(&#39;Fiscal_Year&#39;)}};
result = group q_A by &#39;Top_10_Partners_AOV&#39; full, q_B by &#39;Top_10_Partners_AOV&#39;;
result = foreach result generate coalesce(q_A.&#39;Top_10_Partners_AOV&#39;, q_B.&#39;Top_10_Partners_AOV&#39;) as &#39;Top 10 Partners AOV&#39;, coalesce(last(q_A.&#39;RANK&#39;),last(q_B.&#39;RANK&#39;)) as &#39;RANK&#39;,sum(q_A.&#39;AOV_TOP_10&#39;) as &#39;FY18&#39;, sum(q_B.&#39;AOV_TOP_10&#39;) as &#39;FY19&#39;;
result = foreach result generate &#39;Top 10 Partners AOV&#39;, &#39;RANK&#39;,&#39;FY18&#39;, &#39;FY19&#39;, (FY19-FY18)/FY18 as &#39;Growth&#39;;
result = order result by (&#39;RANK&#39; asc);
result = foreach result generate &#39;Top 10 Partners AOV&#39;, &#39;FY18&#39;, &#39;FY19&#39;, (FY19-FY18)/FY18 as &#39;Growth&#39;;result = limit result 2000;

